import pandas as pd
from bs4 import BeautifulSoup

result = pd.DataFrame(columns =['ID','TITLE','FLOOR','SECTION','ROW','NUMBER','LEFT','TOP','DATA-TRANSFORM'])

soup = BeautifulSoup(html_text,'html.parser')
seats = soup.find_all('div')

for seat in seats[1:] :
    ID = seat.get('id')
    TITLE = seat.get('title')
    
    result.loc[ID,['ID','TITLE']] = ID,TITLE
    
    if TITLE:
        TITLE = TITLE.split(']')[-1].strip().split(' ')
        
        for i in TITLE:
            if '층' in i : result.loc[ID,'FLOOR'] = i.removesuffix('층')
            if '구역' in i : result.loc[ID,'SECTION'] = i.removesuffix('구역')
            if '열' in i : result.loc[ID,'ROW'] = i.removesuffix('열')
            if '번' in i : result.loc[ID,'NUMBER'] = i.removesuffix('번')
    STYLE = seat.get('style').split(';')
    for style in STYLE:
        try: 
            key, value = style.split(':')
        
            if key.strip().upper() in result.columns:
                result.loc[ID,key.strip().upper()] = value.strip()
        except:pass
    result.loc[ID,'DATA-TRANSFORM'] =  seat.get('data-transform')
    
result['DATA-TRANSFORM'] = result['DATA-TRANSFORM'].map(lambda x : x.split('(')[-1][:-1] if not pd.isna(x) else x)
result.rename(columns={'DATA-TRANSFORM':'ROTATE'})
result.to_excel('..\\0_input\\THEATER_SEAT_____.xlsx', sheet_name='해오름극장')

